//import java.lang.*;import java.util.*; public class Main { 	public static void main(String[] args) {		Scanner scanner = new Scanner(System.in);		int n = scanner.nextInt(); 		int m = scanner.nextInt();		int[] ai = new int[m];		int[] bi = new int[m];		for (int i = 0; i < m; ++i)		{			ai[i] = scanner.nextInt();			bi[i] = scanner.nextInt();		}				int [] arr = new int[4];		arr[0] = ai[0];		arr[1] = bi[0];		boolean flag = false;		boolean can = false;		boolean cancan = true;		for (int i = 0; i < 2; ++i)		{			cancan = true;			for (int k = 1; k < m; ++k)			{				if(ai[k] != arr[i] && bi[k] != arr[i])				{					cancan = false;					arr[2] = ai[k];					arr[3] = bi[k];					for (int j = 2; j <= 3; ++j)					{						flag = false;						for (int a = k; a < m; ++a)						{							if (ai[a] != arr[j] && bi[a] != arr[j]									&& ai[a] != arr[i] && bi[a] != arr[i])							{								flag = true;								break;							}						}						if (!flag)						{							can = true;							break;						}					}				} // end if				else				{					continue;				}				break;			}			if (can || cancan)				break;		}				if (!can && !cancan)			System.out.println("NO");		else			System.out.println("YES");		scanner.close();	} // end main	}			 		 				   		 		 		 			  			
